    describe("fileToArray", function() {

        beforeEach(function() {
            spyOn(Service.file_to_array_handlers, 'xlsx').and.returnValue([]);
            spyOn(Service.file_to_array_handlers, 'ods').and.returnValue([]);
            spyOn(Service.file_to_array_handlers, 'xls').and.returnValue([]);
            spyOn(Service.file_to_array_handlers, 'txt').and.returnValue([]);
            spyOn(Service.file_to_array_handlers, 'csv').and.returnValue([]);
        });

        it("should return an array", function () {
            var result = Service.fileToArray({}, 'xlsx');
            expect(_.isArray(result)).toBeTruthy();
        });

        it("should throw an error if no file_data is passed", function () {
            expect(function () {
                Service.fileToArray();
            }).toThrowError(Service.MESSAGE_FILE_DATA_IS_REQUIRED);
        });
        it("should throw an error if no file_type is passed", function () {
            expect(function () {
                Service.fileToArray({});
            }).toThrowError(Service.MESSAGE_FILE_TYPE_IS_REQUIRED);
        });
        it("should throw an error if file_type is not supported", function () {
            expect(function () {
                Service.fileToArray({}, 'aaaaa');
            }).toThrowError(Service.MESSAGE_UNSUPPORTED_FILE_TYPE);
        });

        it("should call file_to_array_handlers.xlsx if file_type is xlsx", function () {

            var data = {a: "A"};
            Service.fileToArray(data, 'xlsx');
            expect(Service.file_to_array_handlers.xlsx).toHaveBeenCalledWith(data, undefined, 'row');
        });
        it("should call file_to_array_handlers.ods if file_type is ods", function () {

            var data = {a: "A"};
            Service.fileToArray(data, 'ods');
            expect(Service.file_to_array_handlers.ods).toHaveBeenCalledWith(data, undefined, 'row');
        });
        it("should call file_to_array_handlers.xls if file_type is xls", function () {

            var data = {a: "A"};
            Service.fileToArray(data, 'xls');
            expect(Service.file_to_array_handlers.xls).toHaveBeenCalledWith(data, undefined, 'row');
        });
        it("should call file_to_array_handlers.txt if file_type is txt", function () {

            var data = {a: "A"};
            Service.fileToArray(data, 'txt');
            expect(Service.file_to_array_handlers.txt).toHaveBeenCalledWith(data, undefined, 'row');
        });
        it("should call file_to_array_handlers.csv if file_type is csv", function () {

            var data = {a: "A"};
            Service.fileToArray(data, 'csv');
            expect(Service.file_to_array_handlers.csv).toHaveBeenCalledWith(data, undefined, 'row');
        });
    });

    //--------------------------------------------
    // fileToArray (txt)
    //--------------------------------------------

    describe("fileToArray (txt, csv)", function() {

        var txt_data = "A\na1\na2\na3";
        var csv_data = "A,B\na1,b1\na2,b2\na3,b3";
        var type = 'txt';

        var file_data = [txt_data, csv_data];

        _.forEach(file_data, function (data) {

            it("should return an array of sheets", function () {
                var result = Service.fileToArray(data, type);
                expect(_.isArray(result)).toBeTruthy();
            });
            it("should return one sheet", function () {
                var result = Service.fileToArray(data, type);
                expect(result.length).toEqual(1);
            });
            it("each sheet should contain a name property", function () {
                var result = Service.fileToArray(data, type);
                expect(_.has(result[0], 'name')).toBeTruthy();
            });
            it("each sheet should contain a headings property", function () {
                var result = Service.fileToArray(data, type);
                expect(_.has(result[0], 'headings')).toBeTruthy();
            });
            it("each sheet should contain a data property", function () {
                var result = Service.fileToArray(data, type);
                expect(_.has(result[0], 'data')).toBeTruthy();
            });
            it("sheet's name should be Sheet1", function () {
                var result = Service.fileToArray(data, type);
                expect(result[0].name).toEqual("Sheet1");
            });

            // no headings

            it("headings should be an empty object", function () {
                var result = Service.fileToArray(data, type);
                expect(_.isObject(result[0].headings)).toBeTruthy();
                expect(_.isEmpty(result[0].headings)).toBeTruthy();
            });
            it("data should be a populated array", function () {
                var result = Service.fileToArray(data, type);
                expect(_.isArray(result[0].data)).toBeTruthy();
                expect(_.isEmpty(result[0].data)).toBeFalsy();
            });
            it("each data row should contain an array of columns", function () {
                var result = Service.fileToArray(data, type);
                expect(_.isArray(result[0].data[0])).toBeTruthy();
            });
            it("the first column in the first row should be A", function () {
                var result = Service.fileToArray(data, type);
                expect(result[0].data[0][0]).toEqual("A");
            });

            // headings

            it("headings should be populated object", function () {
                var result = Service.fileToArray(data, type, true);
                expect(_.isObject(result[0].headings)).toBeTruthy();
                expect(_.isEmpty(result[0].headings)).toBeFalsy();
            });
            it("headings should contain headings with capital column names as keys", function () {
                var result = Service.fileToArray(data, type, true);
                expect(_.has(result[0].headings, 'A')).toBeTruthy();
                expect(result[0].headings.A).toEqual('A');
            });
            it("data should be a populated array", function () {
                var result = Service.fileToArray(data, type, true);
                expect(_.isArray(result[0].data)).toBeTruthy();
                expect(_.isEmpty(result[0].data)).toBeFalsy();
            });
            it("each data row should contain an object with column names as keys", function () {
                var result = Service.fileToArray(data, type, true);
                expect(_.isObject(result[0].data[0])).toBeTruthy();
                expect(_.has(result[0].data[0], 'A')).toBeTruthy();
            });
            it("column A in the first row should be a1", function () {
                var result = Service.fileToArray(data, type, true);
                expect(result[0].data[0].A).toEqual("a1");
            });
        });
    });

